import React from "react";
import { elements } from "./_color";

const ColorCodes = ({ toShowEls }) => {
  return (
    <div>
      {Object.keys(toShowEls).map((i) => {
        return <div>{i} , color: {}</div>;
      })}
    </div>
  );
};

export default ColorCodes;
